import React, { useState } from 'react';
import './comp2.css';

const Component2 = (props) => {
  const { changeId } = props;
  const [organizationName, setOrganizationName] = useState('');

  const prevComponent = () => {
    changeId(1);
  };

  const nextComponent = () => {
    changeId(3);
  };

  const handleOrganizationChange = (e) => {
    setOrganizationName(e.target.value);
  };

  return (
    <div className="component2">
      <h2>Enter Your Organization Details</h2>
      <br />
      <h3>Organization Name</h3>
      <input className="input-box" value={organizationName} onChange={handleOrganizationChange} />

      <button className="prev-button" onClick={prevComponent}>
        Previous
      </button>
      <button className="save-button" onClick={nextComponent} disabled={!organizationName}>
        Save and Proceed
      </button>
    </div>
  );
};

export default Component2;
